import React from 'react';
import { Link, NavLink } from 'react-router-dom';

export default function Navbar({ user, logoutHandler }) {
  return (
    <nav style={{ padding: '1rem', background: '#333', color: 'white', display: 'flex', justifyContent: 'space-between', alignItems: 'center' }}>
      <div>
        <NavLink to="/" style={{ color: 'white', marginRight: '1rem' }}>Home</NavLink>
        <NavLink to="/cart" style={{ color: 'white', marginRight: '1rem' }}>Cart</NavLink>
        <NavLink to="/custom" style={{ color: 'white', marginRight: '1rem' }}>Custom Pizza</NavLink>
      </div>
      <div>
        {user ? (
          <>
            {user.user.role === 'admin' && (
              <NavLink to="/admin/dashboard" style={{ color: 'yellow', marginRight: '1rem' }}>Admin</NavLink>
            )}
            <NavLink to="/my-orders" style={{ color: 'white', marginRight: '1rem' }}>My Orders</NavLink>
            <span style={{ marginRight: '1rem' }}>Welcome, {user.user.name}</span>
            <button onClick={logoutHandler} style={{ background: 'none', border: 'none', color: 'cyan', cursor: 'pointer', fontSize: '1rem' }}>Logout</button>
          </>
        ) : (
          <>
            <NavLink to="/login" style={{ color: 'white', marginRight: '1rem' }}>Login</NavLink>
            <NavLink to="/register" style={{ color: 'white' }}>Register</NavLink>
          </>
        )}
      </div>
    </nav>
  );
}
